INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 23814, "今日は何の日か、もちろん分かるよね？\nこの世で一番かわいくて美しいボクが\n誕生して、みんなの美意識が刷新された\nことをお祝いする、世界的記念日だよ♪", 23814070, 1, 0, 11, 100811, 0.5, 1, 10);
