INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 27814, "こ、このケーキはクウカのために……？\nそれに、ドＳさんまで……ま、まさか、\nここにあるローソクを使ってクウカに\n何か良からぬことを……！？", 27814069, 1, 0, 11, 104511, 0.5, 1, 10);
