INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (0, 31114, "それならプリンがいいの～！\nこのケーキと同じくらい、でっかい\nプリンが食べたいの～！", 31114076, 1, 0, 11, 100711, 0.5, 1, 10);
